using Algorithms.Strings;
using System.Collections.Generic;
using Xunit;

namespace Algorithms.Tests.Strings
{
    public class AnagramTests
    {
        [Theory]
        [MemberData(nameof(ValuesToTest))]
        public void IsAnagram1_ShouldReturnExpectedValue(string word1, string word2, bool expectedValue)
        {
            var result = Anagram.IsAnagram1(word1, word2);

            Assert.Equal(expectedValue, result);
        }

        [Theory]
        [MemberData(nameof(ValuesToTest))]
        public void IsAnagram2_ShouldReturnExpectedValue(string word1, string word2, bool expectedValue)
        {
            var result = Anagram.IsAnagram2(word1, word2);

            Assert.Equal(expectedValue, result);
        }

        [Theory]
        [MemberData(nameof(ValuesToTest))]
        public void IsAnagram3_ShouldReturnExpectedValue(string word1, string word2, bool expectedValue)
        {
            var result = Anagram.IsAnagram3(word1, word2);

            Assert.Equal(expectedValue, result);
        }

        public static IEnumerable<object[]> ValuesToTest()
        {
            yield return new object[] { "abc", "cba", true };
            yield return new object[] { "Abc", "cba", true };
            yield return new object[] { "abc", "Cba", true };
            yield return new object[] { "aBc", "cba", true };
            yield return new object[] { "abc", "cbA", true };
            yield return new object[] { "a bc", "cba", true };
            yield return new object[] { "abc", "c ba", true };
            yield return new object[] { " abc", "cba", true };
            yield return new object[] { "abc ", "cba", true };
            yield return new object[] { "abc", " cba", true };
            yield return new object[] { "abc", "cba ", true };
            yield return new object[] { "abc", "cbd", false };
            yield return new object[] { "aabc", "abc", false };
            yield return new object[] { "abc", "aabc", false };
            yield return new object[] { "abbc", "cbd", false };
            yield return new object[] { "abc", "cbbd", false };
            yield return new object[] { "Abc", "cbd", false };
            yield return new object[] { "abc", "Cbd", false };
            yield return new object[] { "abc", "cb", false };
            yield return new object[] { "ab", "cbd", false };
            yield return new object[] { "aacc", "ccac", false };
            yield return new object[] { "",
                "",
                false };
        }
    }
}
